import React from 'react';
import './Commands.css'

const commands = [
  {
    name: '핑',
    description: '봇의 핑을 알려줍니다.'
  },
]

function Commands() {
  return (
    <div className='Commands'>
      {commands.map(({ name }, i) => (
        <React.Fragment key={i}>
          <h3>{name}</h3>
        </React.Fragment>
      ))}
    </div>
  );
}

export default Commands;
